import { useSelector } from "react-redux";
import { useState } from "react";

const Regions = ({ onSelectRegion }) => {
  const regions = useSelector((state) => state.regions.value);
  const clicked = useSelector((state) => state.clicked.value);
  return (
    <div className="col s12 m6 l3">
      <h2 className="center-align">Regions</h2>
      <div className="collection">
        {regions.map((region) => (
          <a href="#" className={clicked ? 'collection-item active' : 'collection-item'} key={region} onClick={() => onSelectRegion(region)}>
          {region}
          </a>
        ))}
      </div>
    </div>
  )
}

export default Regions
